var b="url",c="好友参团.html",d="generationDate",e=new Date(1575282821553.79),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="571dbaced0164e6daa0286d3189984fc",u="type",v="Axure:Page",w="好友参团",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="c948f6d806f04cadab8bdcc75a9a4bc2",D="label",E="拼团详情",F="说明",G="<p><span>团长、未成团已参团用户、已支付成功未成团用户进入该页面，可邀请用户参团</span></p><p><span><br></span></p><p><span><br></span></p>",H="2",I="cd57dc1f84934fa2bae753abc7d46e5e",J="<p><span style=\"font-family:'Arial Negreta', 'Arial Normal', 'Arial';font-weight:700;color:#333333;\">未参团人员，查看已满团详情</span></p><p><span style=\"font-family:'Arial Negreta', 'Arial Normal', 'Arial';font-weight:700;color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Negreta', 'Arial Normal', 'Arial';font-weight:700;color:#333333;\">可重新开团和查看其它拼团</span></p>",K="3",L="adba17b0b059413ba3ba5aacdd467fcb",M="邀请新用户参团",N="<p><span>若该商品配置为新用户参团则按钮显示 为”邀请新用户参团“</span></p><p><span>若该商品配置为老用户参团则按钮显示为”邀请好友参团“</span></p>",O="4",P="8dafc4e2779346d3a26002bbc037a7fa",Q="还差1人，赶快邀请好友来拼团",R="<p><span>还差N人=该成团人数-已参团人数</span></p>",S="5",T="65f42e3fd1474f70b9c2cffde80f3065",U="<p><span>参团人员支付成功成团进行提示”支付成功“</span></p><p><span>并显示该页面，其它用户进入拼团详情可查看详情状态页</span></p><p><span><br></span></p><p><span style=\"font-family:'Arial Negreta', 'Arial Normal', 'Arial';font-weight:700;color:#333333;\">拼团成功、支付成功，未参团人查看进入该页面</span></p>",V="6",W="fa1129c4616a4f7290a853a4b16aa5ae",X="(图片 )",Y="<p><span>开团用户为‘团长”</span></p><p><span>显示已参团用户头象，未参团用户显示为空头象</span></p><p><span><br></span></p><p><span>显示个数=成团人数</span></p><p><span>已有头象人数为参团人员，无头象团位为该团缺少的成团人数</span></p>",Z="7",ba="c333f2fbc52043bbb2fe6deb038d0472",bb="还差1人，来不及了，就差你了",bc="<p><span>还差N人=成团人数-参团人数</span></p>",bd="8",be="3fc24404400c4987911624a939764513",bf="一键参团",bg="<p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">顺序：</span><span style=\"font-family:'Arial Normal', 'Arial';color:#D9001B;\">登录--&gt;判断库存--&gt;判断成团有效期--&gt;选规格--&gt;支付--&gt;待成团/成团</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">未登录---登录</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">单规格--支付</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">多规格--选规格</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">若参团用户设置为新用户则按钮为”一键拼团（新用户 【</span><span style=\"font-family:'Arial Normal', 'Arial';color:#D9001B;\">新用户为未在平台支付成功过的用户、老用户为有支付成功过的用户（包含支付成功后退款）</span><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">】）</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">若参团用户设置为老用户则按钮显示为“一键拼团”</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">1、若参团时有其它用户优先支付成功提示“</span><span style=\"font-family:'Arial Normal', 'Arial';\">该团已满，可重新开团</span><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">” 页面刷新 并显示最新状态</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">2、若参团时未刷新 页面团超过24小时、商品下架提示“</span><span style=\"font-family:'Arial Normal', 'Arial';\">该团已结束，可重新开团</span><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">”页面刷新 并显示最新状态</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">3、老用户参加标记为新用户成团进行提示框，点击确认</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">4、判断库存，若库存不足、商品已下架、活动已结束则弹出提示框“</span><span style=\"font-family:'华文细黑';color:#D9001B;\">该商品太火爆了，已被抢光，可参加其它热门拼团哦</span><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\">” 点击查看其它拼团，进入拼团列表。若拼团活动已结束，平台不再做拼团活动，则点击跳转首页</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial';color:#333333;\"><br></span></p>",bh="9",bi="a2ce3c01a79746e4ac2805c35580a376",bj="确定",bk="<p><span>若参团时，多规格商品需用户手动选择规格，点击确定 在拼团详情当前页弹支付</span></p><p><span><br></span></p><p><span>支付成功提示“支付成功”并变更拼团详情状态</span></p><p><span>支付失败停留拼团详情页并提示”支付失败，请重新支付“</span></p>",bl="10",bm="bd84d93b167843f4bd69670af5c540f4",bn="×",bo="<p><span>关闭规格弹框，回到拼团详情页</span></p>",bp="11",bq="cd0b58c859ab416395c6a58d0a1fb047",br="(SVG)",bs="<p><span>由微信进入拼团详情，左上角可进入商城首页</span></p>",bt="12",bu="3f2e73128437440eb278bdd9fc39618c",bv="仅剩",bw="<p><span>开团后倒计时24小时，在页面进行倒数，倒计时结束，未拼团成功页面变更状态为失败</span></p>",bx="13",by="502c98932dd14d64b95e844433586401",bz="猜您喜欢",bA="<p><span>随机100款，每次进入列表显示商品不一样</span></p>",bB="style",bC="baseStyle",bD="627587b6038d43cca051c114ac41ad32",bE="pageAlignment",bF="center",bG="fill",bH="fillType",bI="solid",bJ="color",bK=0xFFECE8E8,bL="image",bM="imageAlignment",bN="near",bO="imageRepeat",bP="auto",bQ="favicon",bR="sketchFactor",bS="0",bT="colorStyle",bU="appliedColor",bV="fontName",bW="Applied Font",bX="borderWidth",bY="borderVisibility",bZ="borderFill",ca=0xFF797979,cb="cornerRadius",cc="cornerVisibility",cd="outerShadow",ce="on",cf=false,cg="offsetX",ch=5,ci="offsetY",cj="blurRadius",ck="r",cl=0,cm="g",cn="b",co="a",cp=0.349019607843137,cq="adaptiveStyles",cr="interactionMap",cs="diagram",ct="objects",cu="id",cv="851a9851d5804e7ca77b7fcbcdc090c2",cw="friendlyType",cx="组合",cy="layer",cz="styleType",cA="visible",cB=true,cC="location",cD="x",cE=351,cF="y",cG=317,cH="imageOverrides",cI="objs",cJ="8661affd9a1e4eebb3d943cefd84424c",cK="矩形",cL="vectorShape",cM="'微软雅黑'",cN="foreGroundFill",cO=0xFFFFFFFF,cP="opacity",cQ=1,cR=393